import React from 'react';
import { 
    IonBackButton,
    IonButtons
} from '@ionic/react';
import { returnDownBack } from 'ionicons/icons';


export const BackBtn: React.FC = () => (
    <IonButtons slot="end">
        <IonBackButton text="" icon={returnDownBack}></IonBackButton>
    </IonButtons>
)

export default BackBtn;
